import React from 'react';

const App = () => {
  return (
    <div>
      <header>
        <img src='asd' alt='jopa'/>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
        <div>
          Main content
        </div>
      </nav>
    </div>
  );
}

export default App;
